import DefaultLayout from "~/Layout/DefaultLayout";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "~/pages/Home";
import Client from "./Client";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
            <Route path="/" element={
              <Client />
            } />
            <Route path="/admin" element={
              <p>Admin</p>
            } />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
